  Code = "class Solution:\n    def secondHighest(self, s: str) -> int:\n        num1, num2 = -1, -1\n        for char in s:\n            if not char.isdigit():\n                continue\n            num = int(char)\n            if num > num2:\n                num1, num2 = num2, num\n            elif num != num2 and num > num1:\n                num1 = num\n        return num1"
